import React, { Component, Fragment } from "react";
import { AppBar, Toolbar, Typography, Button } from "@material-ui/core";
import IconButton from "@material-ui/core/IconButton";

class Header extends Component {
  constructor(props) {
    super(props);
    this.styles = this.props.styles;
  }

  render() {
    return (
      <Fragment>
        <AppBar>
          <Toolbar>
            <IconButton
              lassName={this.styles.menuButton}
              color="inherit"
              aria-label="Menu"
            />
            <Typography
              variant="h6"
              color="inherit"
              className={this.styles.grow}
            >
              Stationary 4 Africa
            </Typography>
            <Button>Login</Button>
          </Toolbar>
        </AppBar>
      </Fragment>
    );
  }
}
export default Header;

